/*
 * buildmd5.h
 * 	Ancient code that creates the input database.
 * 	This was taken from a reference implementation in the corresponding
 * 	wiki page. Ints were replaced by node_t wrappers in vectors.
 *
 * 	The function stores in many intermediates. The first versions implemented
 * 	a multi-root storage where a root would be simultaneously a reference to read
 * 	and a storage for writes. They were initially called PseudoRoots (ids prefixed
 * 	by a P). I changed my mind about the naming and now call them U (for User defined).
 *
 * 	All written production functions have renamed it. Find a P is finding something old.
 *
 * Creating/loading and storing database files and their sections.
 */

